const defaultState = {
  todos: [],
};

const AppContext = createContext(defaultState);

const TodoForm = () => {
  const [title, setTitle] = useState("");

  const handleChange = (e) => {
    setTitle(e.target.value);
  };

  return (
    <div>
      <input type="text" placeholder="Enter Title" onChange={handleChange} />
    </div>
  );
};

const App = () => {};

export default App;
